use super::{super::schema::*};
use diesel::prelude::*;
use diesel::{Insertable, Queryable};
use serde::{Deserialize, Serialize};
use uuid; #[derive(Debug, Deserialize, Serialize, Insertable, Queryable)]
#[table_name = "users"]
pub struct User { pub id: uuid::Uuid, // using uuid to generate random and unique strings for id pub email: String, pub created_at: chrono::NaiveDateTime, pub updated_at: chrono::NaiveDateTime, pub password: String, pub name: String,
} First and foremost , we are importing all the required modules, most important of which use diesel::prelude::* which contains all the required traits we will be using later This is a simple rust struct containing required field for a user, but on top there are two new things #derive... and #[table_name = "users"], these both are attributes for the struct User. Our first attributes contains #[derive... in which derive is a macro which will write impl blocks for us for the provided Traits, namely Debug, helps in printing stuff to stdout easily Deserialize, Serialize will help in [de]serialization for the struct in json as we implement our APIs Insertable, Queryable are Traits , provided by diesel which are required if we want to insert an instance of this struct in a table or query from table respectively [1] Queryable trait requires the fields for the struct to be in the same order as generated in the schema.rs, so make sure both are in the same order. Second attribute, tells rust the name of the table where to insert/query Now, having a simple struct won't help us much right ? Lets simplify creating a new instance of User with a method. Creating methods for a struct is referred to as implementing a struct in rust. impl StructName { ...methods } Using this, we can create a function that will initialize our struct with a method, given required parameters. impl User { pub fn from_details<T: Into<String>>(name: T, email: T, password: T) -> User { User { email: email.into(), password: password.into(), id: uuid::Uuid::new_v4(), name: name.into(), created_at: chrono::Local::now().naive_local(), updated_at: chrono::Local::now().naive_local(), } }
} Something new again right, T: Into<String>, this syntax is called giving a bound to a generic paramerter which in this case is T, this make sure that any parameter provided of type T implements Into<String>. email, password and name are String fields in our struct User, we could have simply used String as type of parameters instead of T. Doing it this way, we can pass any type which implements Into<String> for eg: &str and String. User::from_details(name: "john", .... // OR User::from_details(name: String::from("john"),.... .into() function will convert the value to the required type which in this case is String.

