actix_web works asynchronously, which means it requires an async runtime, as rust doesn't have one inherently. actix_web uses the runtime provided by tokio . For our rust code to work asynchronously, we need to setup an async runtime, actix_web provides us with an attribute macro, [main] which sets it up, with a single line. Macros are just too powerful. In src/api/mod.rs write the following code use actix_web::{self, web, App, HttpServer};
use diesel::r2d2::ConnectionManager;
use r2d2::Pool; #[actix_web::main] //Sets up async runtime pub async fn start_server() -> std::io::Result<()> { dotenv::dotenv().ok(); // Check and read from .env file std::env::set_var( "RUST_LOG", "simeple-authe_server=debug,actix_web=info,actix_server=info", ); // Enable logging for actix_web server env_logger::init(); let database_url = std::env::var("DATABASE_URL").expect("DATABASE_URL must be set"); let api_url = std::env::var("API_URL").unwrap_or(String::from("localhost:9000")); let manager = ConnectionManager::<diesel::PgConnection>::new(database_url); let pool: models::Pool = Pool::builder() .build(manager) .expect("Failed to connection to PG database");
} Till here we are reading DATABASE_URL and API_URL from our .env file. Then creating a new diesel connection manager and building an r2d2 pool to using it to manage database connections.

