Different functions may yield different type of errors, so we can just put any concrete type here. We need to use a trait, specifically std::error::Error trait. This states that all Result's Err should implement std::error::Error. So can't we use fn main() -> Result<(), std::error:Error> {
...
} No we cannot, because rust is a super type and memory safe language. For every function rust compiler need to know the concrete return type and also the memory that type will require. It main were to handle results (?) for multiple function, there is very little possibility of all of them having same Err type for Result, and compiler won't be able to calculate the memory required in compile time. Fortunately there is a workaround for that. Box is pointer to data stored in heap, we can use this to tell the compiler, please don't calculate the memory, just yet. Also dyn is used a prefix whenever a trait object is used as type. So finally, the resulting code would come out as fn main() -> Result<(), Box<dyn std::error:Error>>

