Before moving to rust, in diesel world, we have to create a migration to tell postgres how our database and tables should look like Ensure that diesel CLI is setup and we have .env file in which DB_URL is set properly according to the diesel guide Add more crates to help us in our database ordeal [dependencies]
chrono = { version = "0.4", features = ["serde"] } # For time related functions diesel = { version = "1.4", features = ["postgres", "uuidv07", "r2d2", "chrono"] }
dotenv = "0.15"
uuid = { version = "0.8", features = ["serde", "v4"] }
futures = "0.3.8" serde = { version = "1.0", features = ["derive"] }
serde_json = "1.0" DATABASE_URL="postgres://[user]:[pass]@localhost/todos-cli" To automatically create the database and verify database run diesel setup With all things soundly configured, we are ready for are first migration. To create one run diesel migration generate init. [init] here is the migration's name which can be anything. After the command is finished, we will have a migrations folder created in our project folder, which will contain a folder referencing our init migration which in turn will have two files up.sql and down.sql. up.sql contain SQL code that will executed when we execute this migration, so its the place to write code for creating our users and todos table. -- up.sql CREATE TABLE users ( id UUID NOT NULL PRIMARY KEY, email VARCHAR(100) NOT NULL UNIQUE, created_at TIMESTAMP NOT NULL, updated_at TIMESTAMP NOT NULL, password VARCHAR(200) NOT NULL, name VARCHAR(200) NOT NULL
); CREATE TABLE todos ( id UUID NOT NULL PRIMARY KEY, completed BOOLEAN NOT NULL, title VARCHAR(200) NOT NULL, created_at TIMESTAMP NOT NULL, updated_at TIMESTAMP NOT NULL
); Now, to run/execute this migration diesel migration run After this command, you can check the postgres database to verify if the tables are created properly.

